const Index = props => {
    return (
      <Container>
        <Row xs={2} md={4} lg={6}>
          <Col>
            <Image src="holder.js/171x180" roundedCircle />
          </Col>
          <Col>
            <p>Item 1</p>
            <p>Item 2</p>
            <p>Item 3</p>
          </Col>
        </Row>
      </Container>
    );
  }

  Index.getInitialProps = async ()=>{
    return {}
  }

  export default Index;
